import React from 'react';
import './App.scss';
import Header from './header-component'
import {Hero} from './Hero-component'
import Article from "./article-component";
function App() {
    return (
        <div>
            <Header/>
            <Hero/>
            <Article/>
        </div>
    );
}

export default App;
